import React from "react";
import '../styles/cards.css';
import  { useState } from "react";

function Card({ title, description, price }) {
  return (
    <div className="card">
      <img
        className="card-img-top"
        src="https://via.placeholder.com/350x200"
        alt="Card image cap"
      />
      <div className="card-body">
        <h5 className="card-title">{title}</h5>
        <p className="card-text">{description}</p>
      </div>
      <div className="card-footer text-center">
        <button className="btn btn-primary">{`Cumpara - ${price}`}</button>
      </div>
    </div>
  );
}
function Modal({ show, handleClose, card }) {
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");

  const handleFirstNameChange = (e) => {
    setFirstName(e.target.value);
  };

  const handleLastNameChange = (e) => {
    setLastName(e.target.value);
  };

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handleFormSubmit = (e) => {
    e.preventDefault();
    console.log(`Comanda: ${card.title} - ${firstName} ${lastName} - ${email}`);
    handleClose();
  };

  return (
    <div className={show ? "modal display-block" : "modal display-none"}>
      <section className="modal-main">
        <div className="modal-header">
          <h5 className="modal-title">Comanda: {card.title}</h5>
          <button type="button" className="close" onClick={handleClose}>
            <span>&times;</span>
          </button>
        </div>
        <div className="modal-body">
          <div className="selected-card">
            <img
              className="selected-card-img"
              src="https://via.placeholder.com/150x100"
              alt="Selected card"
            />
            <div className="selected-card-info">
              <h5>{card.title}</h5>
              <p>{card.description}</p>
            </div>
          </div>
          <div className="form-group">
            <label htmlFor="firstName">First Name:</label>
            <input
              type="text"
              className="form-control"
              id="firstName"
              placeholder="Enter first name"
              value={firstName}
              onChange={handleFirstNameChange}
            />
          </div>
          <div className="form-group">
            <label htmlFor="lastName">Last Name:</label>
            <input
              type="text"
              className="form-control"
              id="lastName"
              placeholder="Enter last name"
              value={lastName}
              onChange={handleLastNameChange}
            />
          </div>
          <div className="form-group">
            <label htmlFor="email">Email:</label>
            <input
              type="email"
              className="form-control"
              id="email"
              placeholder="Enter email"
              value={email}
              onChange={handleEmailChange}
            />
          </div>
        </div>
        <div className="modal-footer">
          <button type="button" className="btn btn-secondary" onClick={handleClose}>
            Close
          </button>
          <button type="submit" className="btn btn-primary" onClick={handleFormSubmit}>
            Submit
          </button>
        </div>
      </section>
    </div>
  );
}






function CardGroup() {
 
  const cards = [
    {
      id: 1,
      title: "Slabire rapida",
      description: "Programul perfect pentru a slabi intr-un timp record",
      price: "200 RON",
    },
    {
      id: 2,
      title: "Tone up",
      description: "Programul",
      price: "150 RON",
    },
    {
      id: 3,
      title: "Cardio intens",
      description: "Programul care iti creste rezistenta si iti imbunatateste conditia fizica",
      price: "100 RON",
    },
    {
      id: 4,
      title: "Abdomene de otel",
      description: "Programul care te ajuta sa obtii un abdomen plat si musculos",
      price: "175 RON",
    },
    {
      id: 5,
      title: "Meditatie si relaxare",
      description: "Programul pentru a-ti recupera energia si a te elibera de stres",
      price: "120 RON",
    },
    {
      id: 6,
      title: "Yoga pentru incepatori",
      description: "Programul pentru a descoperi beneficiile yoga si a-ti imbunatati flexibilitatea",
      price: "90 RON",
    },
    {
      id: 7,
      title: "Kick-boxing",
      description: "Programul care iti creste puterea, flexibilitatea si viteza",
      price: "220 RON",
    },
    {
      id: 8,
      title: "Crosfit",
      description: "Programul care iti creste masa musculara si iti imbunatateste conditia fizica generala",
      price: "250 RON",
    },
    {
      id: 9,
      title: "Antrenament functional",
      description: "Programul care iti imbunatateste mobilitatea si forta musculara",
      price: "180 RON",
    },
  ];

  return (
    <div className="container">
      <div className="row row-cols-1 row-cols-md-3 g-4">
        {cards.map(({ id, title, description, price }) => (
          <div className="col" key={id}>
            <Card title={title} description={description} price={price} />
          </div>
        ))}
      </div>
    </div>
  );
}



export default CardGroup;
